import React from 'react';
import Particles from 'react-tsparticles';
import { loadFull } from 'react-tsparticles';
function Aa(){
    const aainit=async(main)=>{
        await loadFull(main);
    }
    return(
        <Particles
        id="tsparticles"
        init={aainit}
        options={{
            background:{
                color:{value:"#000000"},
            }
        }}
        />
    )
}
export default Aa;
